import React from 'react'
import { Link } from 'react-router-dom'
import { assets } from '../assets/assets'
const Navbar = () => {
  return (
    <div className='flex items-center justify-between py-5 font-medium'>
        <img  src={assets.logo} className='w-24 ' alt="" />
        <ul className='hidden sm:flex gap-5 text-sm text-gray-700'>
       <li><Link to="/" className='flex flex-col items-center gap-1'>Home</Link></li>
       <li><Link to="/Collections" className='flex flex-col items-center gap-1'>Collections</Link></li>
       <li><Link to="/About">About</Link></li>
       <li><Link to="/Contact">Contact</Link></li>
       {/* <li><Link to="/Cart">Cart</Link></li> */}
       {/* <li><Link to="/Login">Login</Link></li> */}
       {/* <li><Link to="/Order">Order</Link></li> */}
       {/* <li><Link to="/Placeorder">Placeorder</Link></li> */}
       {/* <li><Link to="/Product">Product</Link></li> */}
       </ul>
    </div>
  )
}

export default Navbar
